"use strict";

assert2(cr, "cr namespace not created");
assert2(cr.plugins_, "cr.plugins_ not created");

var tmr = 0;

var audioElement = new Audio();
audioElement.src = 'data:audio/mpeg;base64,';

var img = "data:image/gif;base64,";

function swag(){

};

cr.plugins_.SWAGAPI = function(runtime)
{
	this.runtime = runtime;
};

(function ()
{

	var pluginProto = cr.plugins_.SWAGAPI.prototype;

	pluginProto.Type = function(plugin)
	{
		this.plugin = plugin;
		this.runtime = plugin.runtime;
	};

	var typeProto = pluginProto.Type.prototype;

	typeProto.onCreate = function()
	{
	};

	pluginProto.Instance = function(type)
	{
		this.type = type;
		this.runtime = type.runtime;
	};

	var instanceProto = pluginProto.Instance.prototype;

	instanceProto.onCreate = function()
	{
		this.apiInstance = null;
		var jvs = document.createElement("script");

		jvs.type = "text/javascript";
		jvs.src = "https://swagapi.shockwave.com/dist/swag-api.js";

		jvs.onload = function(){
		};

		document.getElementsByTagName("head")[0].appendChild(jvs);

		var css = $("<link>", {
		"rel" : "stylesheet",
		"type" :  "text/css",
		"href" : "https://swagapi.shockwave.com/dist/swag-api.css"
		})[0];

		css.onload = function(){
		console.log(jvs);
		console.log(css);
		};

		document.getElementsByTagName("head")[0].appendChild(css);

	};

	instanceProto.onDestroy = function ()
	{
	};

	instanceProto.saveToJSON = function ()
	{

		return {

		};
	};

	instanceProto.loadFromJSON = function (o)
	{

	};

	instanceProto.draw = function(ctx)
	{
	};

	instanceProto.drawGL = function (glw)
	{
	};

	instanceProto.getDebuggerValues = function (propsections)
	{

		propsections.push({
			"title": "My debugger section",
			"properties": [

			]
		});
	};

	instanceProto.onDebugValueEdited = function (header, name, value)
	{
		if (name === "My property")
			this.myProperty = value;
	};

	function Cnds() {};

	Cnds.prototype.MyCondition = function (myparam)
	{
		return myparam >= 0;
	};

	pluginProto.cnds = new Cnds();

	function Acts() {};

	Acts.prototype.Leaderboard = function (myparam)
	{
    this.apiInstance.showDialog ("scores", { title: "Best Score", period: 'alltime', });
	};

	Acts.prototype.Score = function (myparam)
	{
    this.apiInstance.postScore ("best_score", myparam);
	};

	Acts.prototype.startSession = function (myparam, callback)
	{

		swag();

		 this.apiInstance = SWAGAPI.getInstance({
				wrapper: document.getElementById('c2canvasdiv'),
				api_key: this.properties[0],
				theme: 'shockwave',
				debug: true
		 });

		 this.apiInstance.startSession()
		 	.then(function() {
				if(callback) callback();
			});

		console.log(this.apiInstance.startSession.name);
	};

	Acts.prototype.startGame = function (myparam, callback)
	{
		this.apiInstance.startGame()
			.then(function() {
				if(callback) callback();
			});

		console.log(this.apiInstance.startGame.name);
	};

	Acts.prototype.endGame = function (myparam, callback)
	{
		this.apiInstance.endGame()
			.then(function() {
				if(callback) callback();
			});

		console.log(this.apiInstance.endGame.name);
	};

	Acts.prototype.getBestUserScore = function (myparam, callback)
	{
		this.apiInstance.getScores({
      period: 'alltime',
      level_key: myparam,
      current_user: true
    })
      .then(function(scores) {
				console.log(scores);
        if(callback) callback(scores);
      });

		console.log(this.apiInstance.getBestUserScore.name);
	};

	Acts.prototype.Link = function (myparam)
	{
		window.open("https://www.addictinggames.com","_blank");
		console.log("More Games");
	};

	Acts.prototype.Preloader = function (myparam)
	{

		if (tmr == 0) {

		console.log("Preloader started.");

		tmr = 1;

		audioElement.play();

		$("#c2canvas").fadeOut(0)

		switch(myparam) {
			case 0:
				$("head").append("<style>#c2canvasdiv {background-image: url(" + img + ");background-repeat:no-repeat;background-attachment:fixed;background-position:center;background-size:20% auto;}</style>");
			break;
			case 1:
				$("head").append("<style>#c2canvasdiv {background-image: url(" + img + ");background-repeat:no-repeat;background-attachment:fixed;background-position:center;background-size:contain;}</style>");
			break;
			case 2:
				$("head").append("<style>#c2canvasdiv {background-image: url(" + img + ");background-repeat:no-repeat;background-attachment:fixed;background-position:center;background-size:cover;}</style>");
			break;
		}

		setTimeout(function(){
		$("#c2canvas").fadeIn();
		}, 6500);

		}
	};

	pluginProto.acts = new Acts();

	function Exps() {};

	Exps.prototype.MyExpression = function (ret)
	{
		ret.set_int(1337);

	};

	pluginProto.exps = new Exps();

}());
